DECLARE @UserIdentifierImport
 TABLE (
 UserIdentiferDetailsID bigint NULL,
 UserGUID varchar(32) NULL,
 UserIdentifierTypeID varchar(13) NULL,
 IDNumber varchar(50) NULL,
 EffectiveDate date NULL,
 ExpirationDate date NULL,
 IsActive bigint NULL,
 ModifiedOn datetime NULL,
 ModifiedBy bigint NULL,
 CreatedOn datetime NULL,
 CreatedBy bigint NULL,
 SystemCreatedOn datetime NULL,
 SystemModifiedOn datetime NULL
)

	[UserID],
	[UserIdentifierTypeID],
	[IDNumber],
	[EffectiveDate],
	[ExpirationDate],
	[IsActive],
	[ModifiedBy],
	[ModifiedOn]
)
SELECT 
	[UserID],
	UIT.[UserIdentifierTypeID],
	[IDNumber],
	CASE [EffectiveDate] WHEN '' THEN NULL ELSE [EffectiveDate] END AS EffectiveDate, 
	CASE [ExpirationDate] WHEN '' THEN NULL ELSE [ExpirationDate] END AS ExpirationDate,
	IT.[IsActive],
	1 AS ModifiedBy, 
	GETUTCDATE() AS ModifiedOn
FROM Core.Users INNER JOIN @UserIdentifierImport IT
		 ON Users.UserGUID = IT.UserGUID 
	INNER JOIN Reference.UserIdentifierType UIT 
		ON IT.UserIdentifierTypeID = UIT.UserIdentifierType
